  render() {
    return (
      <>
        <Grid textAlign = "center" style={{ height: '100vh' }} verticalAlign = "middle">
          <Grid.Column style={{ maxWidth: 450 }} >
            <Header as='h1' textAlign='center'>
              Internio
            </Header>
            <Header as='h3' textAlign='center' color='red'>
              insert description HERE
            </Header>
          </Grid.Column>

        </Grid>
      </>
    )
  }
};
